import{_ as e,o as i,c as t,g as a}from"./app.f531bb61.js";const n="/assets/talyn-lift.aa7ee985.png",s="/assets/supersonic-inlet.dddf0925.png",r="/assets/tpipe-cfd.acdeeaf9.png",b=JSON.parse('{"title":"Mechanical/Aerospace Engineering Summary","description":"","frontmatter":{"aside":false},"headers":[{"level":2,"title":"Skills Summary","slug":"skills-summary","link":"#skills-summary","children":[]},{"level":2,"title":"Experience","slug":"experience","link":"#experience","children":[]}],"relativePath":"page1.md"}'),o={name:"page1.md"},d=a('<h1 id="mechanical-aerospace-engineering-summary" tabindex="-1">Mechanical/Aerospace Engineering Summary <a class="header-anchor" href="#mechanical-aerospace-engineering-summary" aria-hidden="true">#</a></h1><p>I have over 8 years experience in the aerospace industry. My experience is focused on aircraft design, mechanical component design, computational physics analysis (CFD/FEA), and systems engineering. I look forward to helping you bring your engineering vision to life.</p><h2 id="skills-summary" tabindex="-1">Skills Summary <a class="header-anchor" href="#skills-summary" aria-hidden="true">#</a></h2><table><thead><tr><th>Field</th><th>Keywords</th></tr></thead><tbody><tr><td>Aerospace</td><td>Aircraft Design, CFD, Vehicle Aerodynamcis, Test Engineering,</td></tr><tr><td>Mechanical</td><td>CAD (NX), FEA (Femap/NASTRAN), Additive Manufacturing, Various Manufacturing Methods</td></tr><tr><td>Software</td><td>Python, Matlab, LabView</td></tr><tr><td>Soft Skills</td><td>Requirements Tracking, Program Management, Risk Mitigation</td></tr></tbody></table><h2 id="experience" tabindex="-1">Experience <a class="header-anchor" href="#experience" aria-hidden="true">#</a></h2><details class="details custom-block"><summary>Aircraft Design Engineer, L3/L4 | Talyn Air | 08/21 - 04/23</summary><a href="https://www.talyn.com"><img src="'+n+'" width="350" height="350"></a><ul><li>Aircraft design generalist. Conducted trade studies across various disciplines to help size and design an eVTOL aircraft system. Subsystems investigated include propellers, rotors, motors, battery systems, wings, empennage design, and avionics. Utilized OpenVSP and Python to conduct MDAO trade studies.</li><li>Post-processed subscale flight test data to validate aerodynamic predictions and identify system performance. Utilized this data into a 6DOF Simulink model.</li><li>Utilized Vortex-Lattice aerodynamics solvers to predict the performance of both the aircraft and its propellers. Developed aerodynamic databases for use in 6DOF model.</li><li>Configured the vehicle OML with input from various subdisciplines. Kept meticulous record of a change log to track vehicle changes.</li><li>Generated airloads from V-n diagram (per CFR 23) for use in a structural model in order to determine critical load cases. Handed off aerodynamic loads to structures team for FEA.</li><li>Conducted trade studies on various battery architectures to converge upon design which met vehicle energy and power requirements. This includes conceptual full electric and hybrid powertrain studies.</li><li>Applied load cases to nose gear landing gear FEM  to ensure component safety margins were met.</li><li>Carried various flight parts from concept design to flight integration. This includes managing part numbers through out the release workflow, managing component requirements, and conducting loads and structural analysis to size hardware.</li><li>Generated test cards for static thrust propeller testing with expected loads of up to 700lb.</li><li>Captured live test data utilizing NI DAQ with LabView. Data post-processed with Python scripts.</li></ul></details><details class="details custom-block"><summary>Propulsion Engineer, L2/L3 | Northrop Grumman | 01/18 - 07/21</summary><img src="'+s+'" width="350" height="350"> - Led multi-disciplinary teams in designing and integrating clean sheet sub- to supersonic vehicle inlets and exhaust ducts which positioned team to capture various RFP. Design phases included conceptual, preliminary, and detailed design. - Conducted parametric engine cycle analysis to determine engine performance across flight envelope. Performed gradient-based engine cycle optimization by setting design variables, objectives, and constraints. - Generated and conducted parametric CFD studies of relevant geometries for vehicle-inlet integration. Automated linking between softwares to take model from CAD to CFD to post-process. - Utilized CFD with aerodynamic shape optimization techniques to improve propulsion system performance; this included setting objetive and constraint functions. Wrote accompanying process documents to disseminate knowledge. Made significant progress in making this technique a group standard practice in design cycle. - Acquired and analyzed data during live testing of vehicle model at NASA wind tunnel. Developed and documented tools to improve inlet analysis and design. Wrote final report and communicated findings to customers in final briefing. - Implemented and managed schedule-driven technical plans for a variety of preliminary and conceptual design programs. These included considerations of cost, engineer and manufacturing hours, and fiscal cycles. Managed program to meet cost/budget forecasts. Programs ranged in sized from $0.3 to $1.0 million. </details><details class="details custom-block"><summary>Loads &amp; Dynamics Engineer, L2 | Northrop Grumman | 11/16 - 1/18</summary><ul><li>Calculated flight loads on air vehicle utilizing various softwares including FEMAP and ZONAIR. Gained experience running MSC and NX NASTRAN to obtain V-F-G results.</li><li>Created a Matlab tool to simulate aircraft loads during various Navy carrier landing conditions. Work focus was on time-histories of landing gears to determine fatigue load cycles. Ground loads delivered as NASTRAN grid/load BDFs. Studies included taxi, catapult, arresting hook, and crosswind landing cases.</li><li>Work helped standardized ground loads delivery process across work centers. Prepared material and presented tool to senior team members over a 32-hour training.</li></ul></details><details class="details custom-block"><summary>VMS Technician, L2 | Northrop Grumman | 12/17 - 03/18</summary><ul><li>Performed routine electrical lab maintenance tasks including terminating various cable types, soldering electrical components, creating breadboard test beds, affixing electrical enclosures.</li><li>Set up a rotating actuator for a HITL test bed. Interfaced the DAQ unit to the actuator via Matlab Simulink.</li><li>Generated Simulink models of electro-mechanical systems.</li></ul></details><details class="details custom-block"><summary>Summer Intern / Masters Thesis | Air Force Research Lab | 08/14 - 07/16</summary><img src="'+r+'" width="350" height="350"> - Wrote M.S. thesis which analyzed the mixing behavior within a T-type jet-in-crossflow configuration. - Performed grid generation through ANSYS and GridPro gridding software. - Ran simulation utilizing commercial FLUENT package. Utilized HPC systems for job submittal. - Ran CFD simulation with RANS and pseudo-DNS models. Determined solution sensitivity to grid resolution and y+ metrics. - Conducted parametric study to analyze pertinent flow parameters and effects on vortical structures. - Summarized and presented results on a biweekly basis to senior team members. - Identified primary vortical structures in flow field, determined parameters pertinent to mixing efficiency, and validated results with experiment and literature findings.  </details>',10),l=[d];function c(m,u,g,p,h,f){return i(),t("div",null,l)}const v=e(o,[["render",c]]);export{b as __pageData,v as default};
